def eat(self, point: int) -> Any:

  eaten_tokens = self._release_ranges[-1].tokens

  if point < len(eaten_tokens):

    return eaten_tokens[point]

  else:

    while point >= len(eaten_tokens):

      token = next(self._tokens)

      eaten_tokens.append(token)

    return token
